//github.com/fxss"}]},"readingTime":{"minutes":4.9,"words":1470},"filePathRelative":"js/使用 js 实现 链表.md","excerpt":"<p>链表是由一组节点组成的集合。</p>\\n<h2>单向链表</h2>\\n<p>每个节点都使用一个对象的引用指向它的后驱，指向另一个节点的引用叫做链。在链表的最前面有一个特殊节点，叫做头节点。</p>\\n<h3>单向链表插入</h3>\\n<p>向链表中插入一个节点，需要修改它前面节点（前驱）的链，使其指向新加入的节点，新加入的节点的链指向原来前驱指向的节点。</p>\\n<h3>单向链表删除</h3>\\n<p>从链表中删除一个节点，将待删除节点的前驱节点的链指向待删除节点的后驱节点，同时将待删除节点的链指向 <code>null</code> 。</p>\\n<h3>单向链表属性及方法</h3>\\n<table>\\n<thead>\\n<tr>\\n<th>列表</th>\\n<th>属性或方法</th>\\n<th>描述</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td>find</td>\\n<td>方法</td>\\n<td><code>find(item)</code> 从链表头节点向后查找某个节点，查找到节点则返回对应节点，查找不到则返回 <code>null</code></td>\\n</tr>\\n<tr>\\n<td>findPrev</td>\\n<td>方法</td>\\n<td><code>findPrev(item)</code> 从链表头节点向后查找某个节点的后驱为 <code>item</code>，查找到节点则返回对应节点，查找不到则返回 <code>null</code></td>\\n</tr>\\n<tr>\\n<td>insert</td>\\n<td>方法</td>\\n<td><code>insert(newElement, item)</code> 向链表中的 <code>item</code> 节点之后插入 <code>newElement</code> 节点，成功返回 <code>true</code> ，失败返回 <code>false</code></td>\\n</tr>\\n<tr>\\n<td>remove</td>\\n<td>方法</td>\\n<td><code>remove(item)</code> 从链表中删除 <code>item</code> 节点，成功返回 <code>true</code> ，失败返回 <code>false</code></td>\\n</tr>\\n<tr>\\n<td>display</td>\\n<td>方法</td>\\n<td>返回链表中所有节点 <code>element</code> 属性组成的数组</td>\\n</tr>\\n<tr>\\n<td>displayString</td>\\n<td>方法</td>\\n<td>返回链表中所有节点 <code>element</code> 属性组成的字符串，以 <code>,</code> 分隔</td>\\n</tr>\\n<tr>\\n<td>length</td>\\n<td>方法</td>\\n<td>返回链表中节点个数</td>\\n</tr>\\n<tr>\\n<td>show</td>\\n<td>方法</td>\\n<td>返回链表中按顺序第 <code>pos</code> 个节点，从 0 开始</td>\\n</tr>\\n<tr>\\n<td>advance</td>\\n<td>方法</td>\\n<td><code>advance(number)</code> 按照链表顺序，继续向后移动 number 个节点，最多移动到链表最后一个节点</td>\\n</tr>\\n<tr>\\n<td>back</td>\\n<td>方法</td>\\n<td><code>back(number)</code> 按照链表顺序，反方向向前移动 number 个节点，最多移动到链表的第一个节点（非链表的头节点）</td>\\n</tr>\\n</tbody>\\n</table>","autoDesc":true}');export{d as comp,r as data};
